function Wallets() {
  return <h1>Wallets</h1>;
}

export default Wallets;

export async function loader() {
  const responce = await fetch('http://localhost:8080/wallets');
  console.log(responce);
  if (!responce.ok) {
    throw new Error('Could not fetch wallets');
  } else {
    // console.log(responce);
    return responce;
  }
}
